import React from 'react'
import '../styles/expenseItem.css'
import { expenses } from '../data/expenses';
import ExpenseCard from './ExpenseCard';

const ExpenseItem = () => {

    return (
        <>
            {expenses.map(expense => <ExpenseCard expense={expense} />)}
        </>
    )
}

export default ExpenseItem
